import { BrowserRouter } from 'react-router-dom';
import Prueba from './componentes/Prueba';
import Pruebados from './componentes/Pruebados';
function App() {
  return (
    <BrowserRouter>
      <header className="App-header">

        <Prueba/>
        <Pruebados/>
      </header>
    </BrowserRouter>
  );
}

export default App;
